import { Button, Modal, Form, Input, Row, Col } from 'antd';
import React, { useState, useEffect } from 'react';
import {
    GithubOutlined,
    LinkedinOutlined,
    MailOutlined,
    UserOutlined
} from '@ant-design/icons';

import './Home.scss';

export default function Home() {
    const [isVisibleModal, setIsVisibleModal] = useState(false);
    const [modalContent, setModalContent] = useState('')
    console.log('isvisible',isVisibleModal);
    const contact = () => {
        setIsVisibleModal(true)
        setModalContent(
            <Contact />
        )
    }
    const closed = () => {
        setIsVisibleModal(false)
    }
    return (
        <div className='home' id='particles-js'>
            <div className='home__card'>
                <h1>David Díaz</h1>
                <h2>Programador web</h2>
                <Button type='primary' className='btn-contact' onClick={contact}>Contacta</Button>
                <div classname='home__ul'>
                    <ul className='ul'>
                        <li><a href='https://github.com/DavidDiaz-github/' target='_blank'><GithubOutlined /></a></li>
                        <li><a href='https://www.linkedin.com/in/david-diaz-fueyo/' target='_blank' ><LinkedinOutlined /></a></li>
                        <li><a href='mailto:david1_43@hotmail.com'><MailOutlined /></a></li>
                    </ul>
                </div>
            </div>
            <Modal
                closeIcon={closed}
                title='Contacto'
                visible={isVisibleModal}
                footer={null}
                style={{textAlign:'center', fontSize:'23px'}}
            >
                {modalContent}
            </Modal>
        </div>
    )
}

function Contact() {
    const { TextArea } = Input;

    return (
        <Form>
            <Row gutter={24}>
                <Col span={24} className='modal'>
                    <Input 
                        prefix={<UserOutlined />}
                        placeholder='Nombre'
                    />
                </Col>
                <Col span={24} className='modal'>
                    <Input 
                        type='email'
                        prefix={<MailOutlined />}
                        placeholder='Correo electronico'
                    />
                </Col>
                <Col span={24} className='modal'>
                    <TextArea 
                        placeholder='Mensaje'
                    />
                </Col>
                <Col span={24}>
                    <Button type='primary' className='btn-send'>Enviar</Button>
                </Col>
            </Row>
        </Form>
    )
}
